import PropTypes from 'prop-types';
import Drawer from '../../shared/Drawer/Drawer';
import { SIDE } from '../../../config/constants';

const EditConfiguration = props => {
    const { isVisibleEditDrawer, closeEditDrawer } = props;

    return (
        <Drawer side={SIDE.right} isVisible={isVisibleEditDrawer} closeDrawer={closeEditDrawer}>
            <div className='bg-white '>
                <h1>{'Configuration Name'}</h1>
            </div>
        </Drawer>
    );
};

EditConfiguration.propTypes = {};

export default EditConfiguration;
